import React from "react";
import Day from "./Day";
import PropTypes from 'prop-types';

class Forecast extends React.Component {
	constructor () {
		super();
		var items = this.props.days;
  	console.log("ITEMS",this.props);
  	var allDays = Object.keys(items).map(function(key) {
			return <li>
				<Day 
					dayname="Tue" 
					tmpMax={items[key]} 
					tmpMin={items[key]} 
					iconName={items[key]} 
				/>
			</li>;
		});
	}

  render() {

  	return (
			<ul className="forecast">
				{ this.allDays	}
			</ul>
    );
  }
}

Forecast.propTypes = {
  days: PropTypes.array
};

export default Forecast;
